general:
  name: idGang
  short: 'migration: needs update'
  description: 'idGang files come in two types, astrometric and photometric. There
    is one astrometric gang file for each field and astrometric row. There is one
    photometric gang file for each field and photometric column. The astrometric gangs
    files have 13 HDUs: a primary, 6 "postage stamp" HDUs for each CCD and 6 "bright
    star measured parameters" HDUs for each CCD. The photometric gangs files have
    16 HDUs: a primary, 5 "quartile" HDUs for each CCD, 5 "postage stamp" HDUs for
    each CCD and 5 "bright star measured parameters" HDUs for each CCD.'
  datatype: FIT
  filesize: 8 KB
  releases:
  - DR8
  - DR9
  - DR10
  - DR12
  - DR11
  - DR13
  - DR14
  - DR15
  - DR16
  - DR17
  environments:
  - PHOTO_DATA
  naming_convention: 'Astrometric: idGang-[RUN]-r[6-9]-[FRAME].fit (RUN is 6 digits,
    FRAME is 4 digits)\nPhotometric: idGang-[RUN]-c[1-6]-[FRAME].fit (RUN is 6 digits,
    FRAME is 4 digits)'
  generated_by: DA
changelog:
  description: Describes changes to the datamodel product and/or file structure from
    one release to another
  releases:
    DR17:
      from: DR16
      note: No changes
    DR16:
      from: DR15
      note: No changes
    DR15:
      from: DR14
      note: No changes
    DR14:
      from: DR13
      note: No changes
    DR13:
      from: DR11
      note: No changes
    DR11:
      from: DR12
      note: No changes
    DR12:
      from: DR10
      note: No changes
    DR10:
      from: DR9
      note: No changes
    DR9:
      from: DR8
      note: No changes
